import { ApplicationSource } from "../restify/HttpServer";
/**
* include all required keys which needs from client configuration
*/
export interface WebConfig {
    /**
 * Specify application source, where our db will be communicated
 * if it is aplx, specify db_url
 */
    applicationSource: ApplicationSource;
    /**
     * If it is application source is applexus source, DB Url is mandatory
     */
    DB_URL?: string;
    /**
     * Logger folder path
     */
    LOG_PATH?: string;
}
